from tokenize import String
from typing import List
import numpy as np


class Solution:
    def findLength(self, A: List[int], B: List[int]) -> int:
        lena= len(A);lenb= len(B)
        if(A==B):return lena
        maxlen=0
        dp=np.zeros((lena, lena),int)
        for i in range(lena-1,-1,-1):
            for j in range(lena-1,-1,-1):
                if A[i] == B[j]:
                    if i< lena-1 and j< lena-1:
                        dp[i][j]=dp[i+1][j+1]+1
                    else:
                        dp[i][j]=1;
                    maxlen=max(dp[i][j],maxlen)
        return maxlen


    def lastSubstring(self, s: str) -> str:
        res=""
        for i in range(len(s)):
            res=max(res,s[i:])
        return res

    def kthSmallest(self, matrix: List[List[int]], k: int) -> int:
        a=np.array(matrix).reshape(-1)
        a=np.sort(a)
        return a[k-1]

    #'?'可以匹配任何单个字符。(couldn't be null)
    #'*'可以匹配任意字符串（包括空字符串
    flag = True
    mark = dict()
    def matchHelper(self, s: str, p: str, i: int, j: int):
        if len(s) < 1:
            if p.replace('*','') == '':self.flag=False
        if self.flag and i < len(s) and j < len(p) and (i not in self.mark or self.mark.__getitem__(i)!=j):
            if p.__getitem__(j) == '?' or s.__getitem__(i) == p.__getitem__(j):
                self.matchHelper(s,p,i+1,j+1)
            elif p.__getitem__(j) == '*':
                if j+1 == len(p):
                    self.flag = False
                else:
                    res1 = False; res2 = False
                    if p.__getitem__(j+1) == '*':
                        res2 = self.matchHelper(s,p,i,j+1)
                    else:# p[j+1]:? or a-z
                        res1 = self.matchHelper(s, p, i, j + 1)  # p[j]->''
                        k=1
                        while i+k< len(s):
                            res2 = self.matchHelper(s, p, i + k, j + 1)
                            k+=1
                    if res1 or res2:
                        self.flag = False
        elif i == len(s) and j == len(p):
            self.flag = False
        elif i == len(s):
            while j < len(p) and p.__getitem__(j) == '*':
                j += 1
            if j == len(p):
                self.flag = False
        self.mark[i] = j

    def isMatch(self, s: str, p: str) -> bool:
        self.flag = True
        self.mark.clear()
        self.matchHelper(s,p,0,0)
        if not self.flag:return True
        return False

    def minHelper(self,dp: [[]], i: int):
        min_v = dp[i][0]
        for j in range(len(dp[i])):
            min_v = min(min_v,dp[i][j])
        return  min_v
    def respace(self, dictionary: List[str], sentence: str) -> int:
        self.mins = 0xffffffff
        mark = []
        self.rsHelper(dictionary,0,sentence,0,mark)
        return self.mins

    mins: int
    def rsHelper(self, dictionary: List[str], begin: int, sentence: str, cnt: int, mark:[]) -> None:
        if self.mins > cnt and (begin, cnt) not in mark and begin < len(sentence):
            mark.append((begin, cnt))
            for i in range(len(dictionary)):
                dlen = len(dictionary[i])
                if begin+dlen <= len(sentence) and sentence[begin:begin+dlen] == dictionary[i]:
                    self.rsHelper(dictionary, begin+dlen, sentence, cnt, mark)
            self.rsHelper(dictionary, begin+1, sentence, cnt+1, mark)
        elif begin >= len(sentence):
            self.mins = min(self.mins,cnt)
